import React from 'react';

const Footer = () => {
    return (
        <div className="app-footer" >
            <footer class="container" style={{width:'auto', height:'90px', padding:'30px'}}>
                <p style={{textJustify:'center', textSize:'30px'}} >&copy; Rachmat Gunawan 2020</p>
            </footer>
        </div>

    )
}

export default Footer;
